#include "oled_driver.h"
#include "MyDefine.h"
#include "oledfont.h"
unsigned char oled_dma_buffer[512];
uint8_t BufFinshFlag = 0; 
void OLED_Show_Pic(uint8_t BMP[], unsigned char reverse_flag)
{
    if(BufFinshFlag == 0)
    {
        OLED_Set_Position(0, 0);
        
        if(reverse_flag == 0)
            memcpy(oled_dma_buffer, BMP, 512);
        else
        {
            for(unsigned int i = 0; i < 512; i++)
                oled_dma_buffer[i] = ~BMP[i];
        }
        
        HAL_I2C_Mem_Write_DMA(&hi2c2, 0x78, 0x40, I2C_MEMADD_SIZE_8BIT, oled_dma_buffer, 512);
        
        BufFinshFlag = 1;
    }
}

void HAL_I2C_MemTxCpltCallback(I2C_HandleTypeDef *hi2c)
{
    BufFinshFlag = 0;
}

void Safe_Abort_OLED_DMA(void)
{
    // 1. 禁用全局中断（防止中断冲突）
    uint32_t primask = __get_PRIMASK();
    __disable_irq();
    
    // 2. 停止DMA传输
    if(hdma_i2c2_tx.State == HAL_DMA_STATE_BUSY)
    {
        // 禁用DMA传输完成中断
        __HAL_DMA_DISABLE_IT(&hdma_i2c2_tx, DMA_IT_TC);
        
        // 停止DMA
        HAL_DMA_Abort(&hdma_i2c2_tx);

    }
    
    // 3. 停止I2C传输
    if(hi2c2.State == HAL_I2C_STATE_BUSY_TX)
    {

        // 等待当前字节传输完成（避免总线挂起）
        uint32_t timeout = 10000;
        while(__HAL_I2C_GET_FLAG(&hi2c2, I2C_FLAG_BUSY) && timeout > 0)
        {
            timeout--;
        }
        
        // 如果总线仍然忙碌，发送STOP条件
        if(__HAL_I2C_GET_FLAG(&hi2c2, I2C_FLAG_BUSY))
        {
            // 发送STOP条件
            SET_BIT(hi2c2.Instance->CR1, I2C_CR1_STOP);
            
            // 等待STOP完成
            timeout = 10000;
            while(__HAL_I2C_GET_FLAG(&hi2c2, I2C_FLAG_STOPF) == RESET && timeout > 0)
            {
                timeout--;
            }
            
            // 清除STOP标志
            __HAL_I2C_CLEAR_FLAG(&hi2c2, I2C_FLAG_STOPF);
        }
        
        // 清空I2C错误标志
        __HAL_I2C_CLEAR_FLAG(&hi2c2, I2C_FLAG_AF | I2C_FLAG_BERR | I2C_FLAG_ARLO);
        
        // 重置I2C状态
        hi2c2.State = HAL_I2C_STATE_READY;
        hi2c2.Mode = HAL_I2C_MODE_NONE;
    }
    
    // 4. 重置DMA状态
    hdma_i2c2_tx.State = HAL_DMA_STATE_READY;
    
    // 5. 恢复全局中断状态
    if(!primask)
        __enable_irq();
}

void OLED_ShowChar_DMA(uint8_t x, uint8_t y, uint8_t ch, uint8_t fontsize, unsigned char reverse_flag)
{
	uint8_t c = 0;
	c = ch - ' ';

	if (fontsize == 8)
	{
        if(reverse_flag == 0)
            memcpy(oled_dma_buffer, oled_F6X8[c], 6);
        else
        {
            for(unsigned int i = 0; i < 6; i++)
                oled_dma_buffer[i] = ~oled_F6X8[c][i];
        }
        
        OLED_Set_Position(x, y);

        HAL_I2C_Mem_Write(&hi2c2, 0x78, 0x40, I2C_MEMADD_SIZE_8BIT, oled_dma_buffer, 6, 0x100);

	}
    else
    {
        if(reverse_flag == 0)
            memcpy(oled_dma_buffer, &oled_F8X16[c * 16], 16);
        else
        {
            for(unsigned int i = 0; i < 16; i++)
                oled_dma_buffer[i] = ~oled_F8X16[c * 16 + i];
        }
        
        OLED_Set_Position(x, y);

        HAL_I2C_Mem_Write(&hi2c2, 0x78, 0x40, I2C_MEMADD_SIZE_8BIT, oled_dma_buffer, 8, 0x100);
        
		OLED_Set_Position(x, y + 1);
        
		HAL_I2C_Mem_Write(&hi2c2, 0x78, 0x40, I2C_MEMADD_SIZE_8BIT, &oled_dma_buffer[8], 8, 0x100);
    }
}

/**
  * @brief  使用HAL_I2C_Mem_Write显示中文字符（批量传输优化）
  * @param  x: 水平位置 (0-127)
  * @param  y: 垂直位置 (0-7)
  * @param  font_size: 字体大小（目前只支持16）
  * @param  target_char: 目标中文字符的GB2312编码（2字节）
  * @param  reverse_flag: 是否反色显示 (0:正常, 1:反色)
  * @retval None
  */
void Oled_Show_Chinese_Char2(uint8_t x, uint8_t y, uint8_t font_size, uint8_t target_char[2], uint8_t reverse_flag)
{
    // 目前只支持16x16中文字体
    if(font_size != 16)
        return;
    
    // 遍历字库寻找目标字模
    for(uint16_t index = 0; index < 100; index++)
    {
        if(CHINESE_16x16[index].index[0] == target_char[0] && 
           CHINESE_16x16[index].index[1] == target_char[1])
        {
            uint8_t char_data[16];  // 每行16字节数据缓冲区
            
            // 显示上半部分（16x8）
            OLED_Set_Position(x, y);
            
            if(reverse_flag == 0)
            {
                // 正常显示，批量传输上半部分16字节
                HAL_I2C_Mem_Write(&hi2c2, 
                                  0x78, 
                                  0x40, 
                                  I2C_MEMADD_SIZE_8BIT, 
                                  (unsigned char*)&(CHINESE_16x16[index].data),  // 前16字节
                                  16,                         // 数据长度
                                  100);                       // 超时时间
            }
            else
            {
                // 反色显示，需要先处理数据
                for(uint8_t t = 0; t < 16; t++)
                {
                    char_data[t] = ~CHINESE_16x16[index].data[t];
                }
                
                // 批量传输反色后的上半部分
                HAL_I2C_Mem_Write(&hi2c2, 
                                  0x78, 
                                  0x40, 
                                  I2C_MEMADD_SIZE_8BIT, 
                                  char_data, 
                                  16, 
                                  100);
                
                
            }
            
            // 显示下半部分（16x8）
            OLED_Set_Position(x, y + 1);
            
            if(reverse_flag == 0)
            {
                // 正常显示，批量传输下半部分16字节
                HAL_I2C_Mem_Write(&hi2c2, 
                                  0x78, 
                                  0x40, 
                                  I2C_MEMADD_SIZE_8BIT, 
                                  (unsigned char*)&(CHINESE_16x16[index].data[16]),  // 后16字节
                                  16, 
                                  100);
            }
            else
            {
                // 反色显示，需要先处理数据
                for(uint8_t t = 16; t < 32; t++)
                {
                    char_data[t-16] = ~CHINESE_16x16[index].data[t];
                }
                
                // 批量传输反色后的下半部分
                HAL_I2C_Mem_Write(&hi2c2, 
                                  0x78, 
                                  0x40, 
                                  I2C_MEMADD_SIZE_8BIT, 
                                  char_data, 
                                  16, 
                                  100);
            }
            
            // 找到字模并显示完成后退出循环
            break;
        }
    }
}

void Menu_Display_Chinese_Char_Line(unsigned short int x, unsigned char line, char* ch, unsigned char reverse_flag)
{
    switch(line)
    {
        case 0:
            Oled_Show_Chinese_Char2(x, 0, 16, (unsigned char*)ch, reverse_flag);
            break;
        case 1:
            Oled_Show_Chinese_Char2(x, 2, 16, (unsigned char*)ch, reverse_flag);
            break;
    }
    
}

/**
  * @brief  使用 HAL_I2C_Mem_Write 显示字符（批量传输优化）
  * @param  x: 水平位置 (0-127)
  * @param  y: 垂直位置 (0-7)
  * @param  ch: 要显示的字符
  * @param  fontsize: 字体大小 (8 或 16)
  * @param  reverse_flag: 是否反色显示 (0:正常, 1:反色)
  * @retval None
  */
void OLED_ShowChar3(uint8_t x, uint8_t y, uint8_t ch, uint8_t fontsize, uint8_t reverse_flag)
{
    uint8_t c = 0;
    uint8_t char_data[16];  // 最大16字节的字符数据缓冲区
    uint8_t i;
    
    c = ch - ' ';  // 计算字符在字库中的索引
    
    if(fontsize == 16)
    {
        // 16点阵字符，需要显示两行（16x8像素）
        
        // 设置上半部分显示位置
        OLED_Set_Position(x, y);
        
        // 准备上半部分数据（前8字节）
        for(i = 0; i < 8; i++)
        {
            if(reverse_flag == 1)
                char_data[i] = ~oled_F8X16[c * 16 + i];
            else
                char_data[i] = oled_F8X16[c * 16 + i];
        }
        
        // 批量发送上半部分数据
        HAL_I2C_Mem_Write(&hi2c2, 
                          0x78,                // OLED I2C地址（写入）
                          0x40,                // OLED数据寄存器地址
                          I2C_MEMADD_SIZE_8BIT,
                          char_data,           // 数据缓冲区
                          8,                   // 数据长度
                          100);                // 超时时间(ms)
        
        // 设置下半部分显示位置
        OLED_Set_Position(x, y + 1);
        
        // 准备下半部分数据（后8字节）
        for(i = 0; i < 8; i++)
        {
            if(reverse_flag == 1)
                char_data[i] = ~oled_F8X16[c * 16 + i + 8];
            else
                char_data[i] = oled_F8X16[c * 16 + i + 8];
        }
        
        // 批量发送下半部分数据
        HAL_I2C_Mem_Write(&hi2c2, 
                          0x78,
                          0x40,
                          I2C_MEMADD_SIZE_8BIT,
                          char_data,
                          8,
                          100);
    }
    else
    {
        // 8点阵字符，只需要一行（6x8像素）
        
        // 设置显示位置
        OLED_Set_Position(x, y);
        
        // 准备6x8点阵数据
        for(i = 0; i < 6; i++)
        {
            if(reverse_flag == 1)
                char_data[i] = ~oled_F6X8[c][i];
            else
                char_data[i] = oled_F6X8[c][i];
        }
        
        // 批量发送整个字符数据
        HAL_I2C_Mem_Write(&hi2c2, 
                          0x78,
                          0x40,
                          I2C_MEMADD_SIZE_8BIT,
                          char_data,           // 6字节字符数据
                          6,                   // 数据长度
                          100);
    }
}


void Menu_Display_Char(unsigned short int x, unsigned char line, char ch, unsigned char reverse_flag)
{
    switch(line)
    {
        case 0:
            OLED_ShowChar_DMA(x, 0, ch, 16, reverse_flag);
            break;
        case 1:
            OLED_ShowChar_DMA(x, 2, ch, 16, reverse_flag);
            break;
    }
    
}

/**
 * @brief	使用类似printf的方式显示字符串，显示6x8大小的ASCII字符
 * @param x  String start position on the X-axis  range：0 - 127
 * @param y  String start position on the Y-axis  range：0 - 3
 * @param fontsize  字体大小 8/16
 * @param {const char *} *format 待显示的格式化字符串
 * 例如：Oled_Printf(0, 0, 12, 0, "Data = %d", dat);
**/
int Oled_Printf(uint8_t x, uint8_t y, uint8_t fontsize, const char *format, ...)
{
	char buffer[256]; // 临时存储格式化后的字符串
	va_list arg;      // 处理可变参数
	int len;          // 最终字符串长度

	va_start(arg, format);
	// 安全地格式化字符串到 buffer
	len = vsnprintf(buffer, sizeof(buffer), format, arg);
	va_end(arg);

	OLED_ShowStr(x, y, buffer, fontsize);

	return len;
}

